import React from "react";

function Food({ fav, color }) {
  return (
    <div>
      <h3>Hello! I LUV {fav}</h3>
      <div>
        {fav} color is {color}
      </div>
    </div>
  );
}

const foodIlike = [
  {
    id: 1,
    name: "kimchi",
    color: "red",
  },
  {
    id: 2,
    name: "pizza",
    color: "yellow",
  },
  {
    id: 3,
    name: "tomato",
    color: "red",
  },
];

function App() {
  return (
    <div>
      <h2>Hello</h2>
      {foodIlike.map((food) => (
        <Food key={food.id} fav={food.name} color={food.color} />
      ))}
    </div>
  );
}

// div안에 있어야 한다. (태그안에)
export default App;
